import React from 'react';



const Wallet = (props) => {

	return (
		<div>
				<div className={"flex justify-between"}>
					<h1 className={"font-bold"}>{'Your Wallet (s)'}</h1>
					<div className={"bg-buttonActive rounded-lg p-3"}>
						<div className={"flex"}>
							<div><img src="/assets/plusIcon.svg" alt="plus icon" /></div>
							<div className={"text-white font-bold"}>{"Create New Wallet"}</div>
						</div>
					</div>
				</div>

				<div className={"grid grid-cols-2"}>

				<div></div>
				<div></div>

				</div>
		</div>
		);
}

export default Wallet;
